pub static POSTGRES_TABLES: GrammarTables = GrammarTables {
    instructions: INSTRUCTIONS,
    child_ids: CHILD_IDS,
    terminators: TERMINATORS,
    strings: STRINGS,
    aux_data: AUX_DATA,
    aux_data_offsets: AUX_DATA_OFFSETS,
    regex_patterns: REGEX_PATTERNS,
    simple_hints: SIMPLE_HINTS,
    hint_string_indices: HINT_STRING_INDICES,
    simple_hint_indices: SIMPLE_HINT_INDICES,
    segment_type_offsets: SEGMENT_TYPE_OFFSETS,
};

pub fn get_postgres_root_grammar_id() -> GrammarId {
    GrammarId(4516)
}
pub fn get_postgres_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_postgres_root_grammar_id(),
        tables: &POSTGRES_TABLES,
    }
}
pub fn get_postgres_root_grammar() -> RootGrammar {
    get_postgres_root_grammar_table()
}
